import styled from "styled-components";

export const Container = styled.div``;
export const Box = styled.div`
  display: flex;
  p {
    font-size: 1rem;
  }

  button {
      display: flex;
      border: 0;
      outline: none;
      justify-content: center;
      align-items: center;
      padding: 8px;
      border: 1px solid gray;
  }
`;
